PDFButton = React.createClass({
  createPDF() {
    let doc = new jsPDF();
    let imgData = 'data:image/jpeg;base64,';

    console.log(imgData);

    doc.text(20, 20, 'HELLO!');
    doc.setFont("courier");
    doc.setFontType("normal");
    doc.text(20, 30, 'This is a PDF document generated using JSPDF.');
    doc.text(20, 50, 'YES, Inside of PhoneGap!');
    doc.addImage(imgData, 'JPEG', 15,40,180,160);
    let pdfOutput = doc.output();

    console.log("file system....");

    window.requestFileSystem(LocalFileSystem.PERSISTENT, 0, function(fileSystem) {
      console.log(fileSystem.name);
      console.log(fileSystem.root.name);
      console.log(fileSystem.root.fullPath);

      fileSystem.root.getFile("test.pdf", {
        create: true
      }, function(entry) {
        var fileEntry = entry;
        console.log(entry);

        entry.createWriter(function(writer) {
          writer.onwrite = function(evt) {
            console.log("write success");
          };

          console.log("writing to file");
          writer.write(pdfOutput);
        }, function(error) {
          console.log(error);
        });

      }, function(error) {
        console.log(error);
      });
    }, function(event) {
      console.log(evt.target.error.code);
    });
  },

  render() {
    return (
      <div id="eventPDF-creator">
        <button className="btn btn-primary" id="pdf-generator" onClick={this.createPDF}>Create Check-in PDF</button>
      </div>
    );
  }
});
